import React from "react";
import "./demo.css";
export const MyComponent = () => {
    // setState setData
    // data: {
        // myName:'John Doe'
    // }
    // MVVM
    // react hooks
    const [myName,setMyName] = React.useState('John Doe')
    return 
    <div>
        <h2 className="title">{myName}</h2>
        <input
        value={myName}
        onChange={(e) => setMyName}
        />
    </div>
}
